import React from 'react';
// import firebase
import { firebase, config } from './Scripts/Firebase';
import {FirebaseAuthProvider, IfFirebaseAuthed, IfFirebaseUnAuthed} from "@react-firebase/auth";
// Import the pages
import Main from './Main';

let Application = () => {
  let user = {
    displayName: "SpotandJake 100",
    uid: 'mHvcak8OjqZglBlENhQSLqBOgPB3',
    photoURL: "https://lh3.googleusercontent.com/a-/AOh14Gg6mjzn5KwNGqOcuCE9F_qS1X1Jci0vr4S3TeiTJQ=s96-c"
  }
  return (
    <div className="Page">
      <FirebaseAuthProvider firebase={firebase} {...config}>
        <IfFirebaseUnAuthed>
          {({ isSignedIn, user, providerId }) => {
            return (
              <button
                onClick={() => {
                  const googleAuthProvider = new firebase.auth.GoogleAuthProvider();
                  firebase.auth().signInWithPopup(googleAuthProvider);
                }}
              >
                Sign In with Google
              </button>
            )
          }}
        </IfFirebaseUnAuthed>
        <IfFirebaseAuthed>
          {({ user }) => (<Main User={user} />) }
        </IfFirebaseAuthed>
      </FirebaseAuthProvider>
      <Main User={user} />
    </div>
  );
}

export default Application;
